import React from 'react';

import Button from './button';
import './userList.css';

const UserList=(props)=>{
    const rowData = props.rowData.map(el=>(
        <tr>
            <td>{el.orderData.Fullname}</td>
            <td>{el.orderData.DOB}</td>
            <td>{el.orderData.Languages}</td>
            <td>{el.orderData.Gender}</td>
            <td>{el.orderData.About}</td>
        </tr>   
    ))
    return(
        <div className="userList">
            <h2>Users List</h2>
            <table className="table table-bordered">
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>Birth Date</th>
                        <th>Languages</th>
                        <th>Gender</th>
                    </tr>
                </thead>
                <tbody>
                    {rowData}
                </tbody>
            </table>
            <Button click={props.click}/>
        </div>
    )
}

export default UserList;
